import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import Modal from '../component/Modal';

const DashboardPage = () => {
    const [orders, setOrders] = useState([]);
    const [selectedOrder, setSelectedOrder] = useState(null);
    const [showCreateOrder, setShowCreateOrder] = useState(false);
    const [message, setMessage] = useState('');
    const navigate = useNavigate();

    // Setup axios configuration and check authentication
    useEffect(() => {
        const token = localStorage.getItem('token');
        if (!token) {
            navigate('/login');
            return;
        }

        // Set up axios default headers for all requests from this component
        axios.defaults.headers.common['Authorization'] = `Bearer ${token}`;

        fetchOrders();
    }, [navigate]);

    const fetchOrders = async () => {
    try {
        const response = await axios.get(`${process.env.REACT_APP_API_URL}orders/`, {
            headers: {
                'Authorization': `Bearer ${localStorage.getItem('token')}`
            },
            withCredentials: true
        });
        setOrders(response.data);
    } catch (error) {
        console.error("Fetch orders error:", error);
        if (error.response?.status === 401) {
            localStorage.removeItem('token');
            localStorage.removeItem('userData');
            navigate('/login');
        } else {
            setMessage('Error loading orders');
        }
    }
};

    const handleCreateOrder = async (orderData) => {
        try {
            await axios.post('http://localhost:8000/api/orders/', orderData, {
                headers: {
                    'Authorization': `Bearer ${localStorage.getItem('token')}`
                }
            });
            setMessage('Order submitted successfully! We will provide the pricing soon.');
            setShowCreateOrder(false);
            fetchOrders(); // Refresh orders list
        } catch (error) {
            if (error.response && error.response.status === 401) {
                localStorage.removeItem('token');
                localStorage.removeItem('userData');
                navigate('/login');
            } else {
                setMessage('Error creating order');
            }
        }
    };

    const handleLogout = () => {
        localStorage.removeItem('token');
        localStorage.removeItem('userData');
        navigate('/login');
    };

    const getUserInfo = () => {
        const userDataString = localStorage.getItem('userData');
        return userDataString ? JSON.parse(userDataString) : null;
    };

    return (
        <div className="dashboard-container">
            <div className="dashboard-header">
                <div className="user-info">
                    <h1>My Orders</h1>
                    <span>Welcome, {getUserInfo()?.name}</span>
                </div>
                <div className="header-actions">
                    <button
                        className="create-order-button"
                        onClick={() => setShowCreateOrder(true)}
                    >
                        Create New Order
                    </button>
                    <button
                        className="logout-button"
                        onClick={handleLogout}
                    >
                        Logout
                    </button>
                </div>
            </div>

            {message && (
                <div className="message-banner">
                    {message}
                    <button onClick={() => setMessage('')}>×</button>
                </div>
            )}

            <div className="orders-list">
                {orders.map((order) => (
                    <div
                        key={order.id}
                        className="order-card"
                        onClick={() => setSelectedOrder(order)}
                    >
                        <div className="order-header">
                            <h3>Order #{order.id}</h3>
                            <span className={`status-badge ${order.status}`}>
                                {formatStatus(order.status)}
                            </span>
                        </div>
                        <div className="order-info">
                            <p>Created: {new Date(order.created_at).toLocaleDateString()}</p>
                            <p>Total: ${order.quoted_total}</p>
                        </div>
                    </div>
                ))}
            </div>

            {showCreateOrder && (
                <Modal onClose={() => setShowCreateOrder(false)}>
                    {/* Your Create Order Form Component */}
                </Modal>
            )}

            {selectedOrder && (
                <Modal onClose={() => setSelectedOrder(null)}>
                    {/* Your Order Details Component */}
                </Modal>
            )}
        </div>
    );
};

const formatStatus = (status) => {
    return status.split('_').map(word =>
        word.charAt(0).toUpperCase() + word.slice(1)
    ).join(' ');
};

export default DashboardPage;
